I was missing some generic overloads for the ko.utils.arrayX functions. I had to explicitly type the arguments like so:

ko.utils.arrayForEach(this.bikes, (bike: Bike) => { bike.broken = true });

With this commit the type is implicit and typescript still knows the type:

ko.utils.arrayForEach(this.bikes, (bike) => { bike.broken = true });

On my system, the following would throw an error, because it was matching the value-based function definition before the promise-based one. 

```
function():Q.IPromise<string> {
    return doSomething().then(function (stuff) {
        return anotherPromise(stuff);
    })
}
```

I reversed the order of the function overloads so it matches the ones that return promises first, instead of the values.
